import React from 'react';
import logo from "../../resources/images/jplogo.svg";

const AnnounceBar = () => {
    return (
        <div className="announceBar">
            <svg>
                <image href="{logo}" alt="logo" />
            </svg>
        </div>
    );
};

export default AnnounceBar;
